const App = () => {
 
  return (
    <>

     <div>
     {
                <Button onClick={change} variant="dark" disabled on >
      (loading) ?
                    <Spinner
                    as="span"
                    variant="light"
                    size="sm"
                    role="status"
                    aria-hidden="true"
                    animation="border"/>
                      Loading...
                      : !(loading)
                </Button> 

          }
            </div>
    </>
  );
}

export default App;
